Tipos de números frecuentes en programación competitiva: int - representa números enteros y existe entre [\(-2^{31}\), \(2^{31} - 1\)], suele ser usado en la mayoria de los contextos. long double - se usa en entornos donde queremos representar un número que no es entero. Esto común en problemas de geometría o de simulación de un proceso físico, por ejemplo. Este número no es exacto y puede tener errores de precisión. Por lo general, en problemas donde se necesita una representación no entera, los enunciados piden que genere la respuesta con una precisión de 1e-6. Una forma común de lidiar con esto es: long double number = 0.12312;
int digits = 6; // for 1e-6
cout << fixed << setprecision(digits) << number; long long int - este es un número entero pero con el doble de bits. Se usa cuando un int no es suficiente. En mi opinión, este es el tipo de datos más útil y normalmente lo uso de forma predeterminada, en lugar de int .

